import React from 'react'
import './PopUpDemoID.css'
import { useParams, useNavigate } from 'react-router-dom';


const handleCreateDemo = (demoID) => {
    const navigate = useNavigate();
    // Redirect to the demo page
    navigate("/demo/"+demoID)
}

const Loading = ({demoID}) => {
  return (
    <div id="popup">
      <div id="popup-content">
        <p id="popup-text">Your presentation has been created successfully.</p>
        <button onClick={handleCreateDemo(demoID)} id="redirect-button" >Go to presentation</button>
      </div>
    </div>
  )
}

export default Loading
